import React, { useState } from 'react';
import './ReservationPage.css';
import {useNavigate} from 'react-router-dom'

function ReservationPage() {
    const [participantName, setParticipantName] = useState('');
    const [userId, setUserId] = useState('');
    const [email, setEmail] = useState('');
    const [meetingName, setMeetingName] = useState('');
    const [meetingStartTime, setMeetingStartTime] = useState('');
    const [meetingEndTime, setMeetingEndTime] = useState('');
    const [meetingContent, setMeetingContent] = useState('');

    const navigate = useNavigate();

    const handleInviteClick = () => {
        alert(`초대: ${participantName}, ${userId}, ${email}`);
    };

    const handleReserveClick = () => {
        alert(`회의 예약: ${meetingName}, ${meetingStartTime} - ${meetingEndTime}, ${meetingContent}`);
    };

    const handleBackClick = () => {
        navigate('/myconference'); 
    };
//이메일 형식 확인
    const handleEmailChange = (e) => {
        const value = e.target.value;
        setEmail(value);
        const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
        setEmailError(!emailRegex.test(value));
    };

    return (
        <div className='page'>
            <div className='title'>참석자</div>

            <div className='contentWrap'>
                <div className='inputTitle'>참석자명</div>
                <div className='inputWrap'>
                    <input 
                        type='text'
                        className='input'
                        value={participantName} 
                        onChange={(e) => setParticipantName(e.target.value)}
                    />
                </div>

                <div className='inputTitle'>아이디</div>
                <div className='inputWrap'>
                    <input 
                        type='text'
                        className='input'
                        value={userId} 
                        onChange={(e) => setUserId(e.target.value)}
                        placeholder='아이디를 입력해주세요'
                    />
                </div>

                <div className='inputTitle'>이메일 주소</div>
                <div className='inputWrap'>
                    <input 
                        type='text'
                        className='input'
                        value={email} 
                        onChange={handleEmailChange}
                    />
                    {emailError && <div className='error'>올바른 이메일 형식으로 입력해주세요.</div>}
                </div>

                <button 
                    onClick={handleInviteClick}
                    className='bottomButton'>
                    참석자 초대하기
                </button>

                <div className='inputTitle'>회의 이름</div>
                <div className='inputWrap'>
                    <input 
                        type='text'
                        className='input'
                        value={meetingName} 
                        onChange={(e) => setMeetingName(e.target.value)}
                    />
                </div>

                <div className='inputTitle'>회의 시간 설정하기</div>
                <div className='inputWrap'>
                    <input 
                        type='text'
                        className='smallInput'
                        value={meetingStartTime} 
                        onChange={(e) => setMeetingStartTime(e.target.value)}
                        placeholder='시작 시간'
                    />
                    <span className='separator'>-</span>
                    <input 
                        type='text'
                        className='smallInput'
                        value={meetingEndTime} 
                        onChange={(e) => setMeetingEndTime(e.target.value)}
                        placeholder='끝나는 시간'
                    />
                </div>

                <div className='inputTitle'>회의 내용</div>
                <div className='inputWrap'>
                    <input 
                        type='text'
                        className='input'
                        value={meetingContent} 
                        onChange={(e) => setMeetingContent(e.target.value)}
                    />
                </div>

                <div className='buttonWrap'>
                    <button 
                        onClick={handleReserveClick}
                        className='bottomButton'>
                        회의 예약하기
                    </button>

                    <button 
                        onClick={handleBackClick}
                        className='bottomButton'>
                        뒤로 돌아가기
                    </button>
                </div>
            </div>
        </div>
    );
}

export default ReservationPage;
